import { User } from '@flashcards/core'
import { GetCurrentUserService, GetCurrentUserUseCase } from '../usecase'

class GetCurrentUser implements GetCurrentUserUseCase {
  private readonly service: GetCurrentUserService

  constructor(service: GetCurrentUserService) {
    this.service = service
  }

  getCurrentUser(): Promise<User> {
    return this.getCurrentUser()
  }
}

export { GetCurrentUser }
